          <span className="commentnickname">닉네임</span>
        </p>
        <p>동글동글한 핑크색 공 모양 생김새에 뭐든지 빨아들여서 삼키는 능력을 가진, 별의 커비 시리즈의 주인공!</p>
        <time>10분 전</time>
    </li>
  );
};

